package com.ibm.arrays;

public class Array2D {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int nums[][];
		nums = new int[2][5];
		for(int value : nums[0]) {
			System.out.print(value);
		}
		System.out.println();
		for(int val:nums[1]) {
			System.out.print(val);
		}

	}

}
